let lang = Cypress.env('LANGUAGE') || 'en';
const messages = Cypress.env('labelYoutube');
let judulFilm, channel;
cy.visit(`${Cypress.env("youtube")}`);
_homePage.default.getLangYoutube().then(langAttr => {
  cy.log(`Language Default : ${langAttr}`);
  lang = langAttr === "id-ID" ? "id" : "en";
});
cy.then(() => {
  _homePage.default.goToTrendingMenu(messages[lang].explore);
  _homePage.default.goToMoviesTab(messages[lang].movie);
  // Get Judul Film
  _trendingListPage.default.getJudulFilm().then(judul => {
    judulFilm = judul;
  });
  // Get Channel
  _trendingListPage.default.getChannelYoutube().then(src => {
    channel = src;
  });
  cy.then(() => {
    cy.log(`Judul Film : ${judulFilm}`);
    cy.log(`Channel Name : ${channel}`);
    _trendingListPage.default.clickMovies();
    cy.wait(10000);
    _moviePage.default.getMovieTitle(judulFilm);
    _moviePage.default.getMovieChannel(channel);
    _moviePage.default.clickShareAndCopy(messages[lang].share);
    _moviePage.default.getLinkUrl().then(link => {
      cy.log(`Link Url : ${link}`);
    });
  });
});
